/*



NOTE: Use event listener on button in App.js so that when it's clicked, it displays API Call.


*/
import {useState} from 'react';
import { useNavigate } from 'react-router-dom';
import Auth from './Auth';
import Dropdown from 'react-bootstrap/Dropdown';
import Pagination from 'react-bootstrap/Pagination';
import InputGroup from 'react-bootstrap/InputGroup';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
export default function Input(){
    const navigate=useNavigate();
    const [componentShowTrue,setComponentShowTrue] = useState(false);
    const [totalPageCount,setTotalPageCount] = useState(null);
    //currentPage is changed whenever page is changed to render new data for that page
    const [currentPage,setCurrentPage] = useState(1);
    //data that will be shown on a particular page
    const[showedData,showData] = useState(null);
    //updates content to whatever page the user wants to see
    function updatePage(page){

    }
    function handleClick(){
          var state = document.getElementById('states').value;
          var city = document.getElementById('city').value.replace(/\s/g,'%20')
          const options = {
            method: 'GET',
            headers: {
              'X-RapidAPI-Key': '855bd2bf2cmshe2a54b2a1587f75p191d25jsn98051050cfc8',
              'X-RapidAPI-Host': 'real-estate12.p.rapidapi.com'
            }
          };
          fetch(`https://real-estate12.p.rapidapi.com/listings/sale?state=${state}&city=${city}&page=1&sort=relevant&type=single-family%2Cmulti-family`, options)
            .then(response => response.json())
            .then(response => {
            setComponentShowTrue(response.properties);
            setTotalPageCount(Math.ceil(response.properties.length/9))
            showData(response.properties.slice(0,9))
            })
    }
    function Paginate(properties,pageSize){
      //for every page, assign the properties that will be shown on that page
      for (var pageIndex = 0;pageIndex<totalPageCount;pageIndex++){
        const firstIndex = pageIndex*pageSize;
        const lastIndex = pageIndex*pageSize+pageSize;
        showData(properties.slice(firstIndex,lastIndex));
      }
    }
    return (

    <div className='input'>
      <Form.Select aria-label='Choose a State' id='states'>
            <option value="AL">Alabama</option>
            <option value="AK">Alaska</option>
            <option value="AZ">Arizona</option>
            <option value="AR">Arkansas</option>
            <option value="CA">California</option>
            <option value="CO">Colorado</option>
            <option value="CT">Connecticut</option>
            <option value="DE">Delaware</option>
            <option value="DC">District Of Columbia</option>
            <option value="FL">Florida</option>
            <option value="GA">Georgia</option>
            <option value="HI">Hawaii</option>
            <option value="ID">Idaho</option>
            <option value="IL">Illinois</option>
            <option value="IN">Indiana</option>
            <option value="IA">Iowa</option>
            <option value="KS">Kansas</option>
            <option value="KY">Kentucky</option>
            <option value="LA">Louisiana</option>
            <option value="ME">Maine</option>
            <option value="MD">Maryland</option>
            <option value="MA">Massachusetts</option>
            <option value="MI">Michigan</option>
            <option value="MN">Minnesota</option>
            <option value="MS">Mississippi</option>
            <option value="MO">Missouri</option>
            <option value="MT">Montana</option>
            <option value="NE">Nebraska</option>
            <option value="NV">Nevada</option>
            <option value="NH">New Hampshire</option>
            <option value="NJ">New Jersey</option>
            <option value="NM">New Mexico</option>
            <option value="NY">New York</option>
            <option value="NC">North Carolina</option>
            <option value="ND">North Dakota</option>
            <option value="OH">Ohio</option>
            <option value="OK">Oklahoma</option>
            <option value="OR">Oregon</option>
            <option value="PA">Pennsylvania</option>
            <option value="RI">Rhode Island</option>
            <option value="SC">South Carolina</option>
            <option value="SD">South Dakota</option>
            <option value="TN">Tennessee</option>
            <option value="TX">Texas</option>
            <option value="UT">Utah</option>
            <option value="VT">Vermont</option>
            <option value="VA">Virginia</option>
            <option value="WA">Washington</option>
            <option value="WV">West Virginia</option>
            <option value="WI">Wisconsin</option>
            <option value="WY">Wyoming</option>
      </Form.Select>
        <InputGroup>
          <InputGroup.Text>City</InputGroup.Text>
          <Form.Control placeholder="Name of City" id='city'>
          </Form.Control>
          <Button variant="dark" id="submitButton" onClick={handleClick}>Submit</Button>
        </InputGroup>
        <Button onClick={()=>{Auth.login(()=>navigate('/db'))}}>View Properties</Button>  
      <div>
        {showedData ? (
          <div className='property-grid'>
            {showedData.map((property)=>(
              <div className='property'>
                {property.home_photos ? 
                  <img src={property.home_photos.collection[0].href} />
                  : <h1>no image</h1>
                }
                <h1>{property.list_price}</h1>
                <h1>{property.description.beds}</h1> 
                <h1>{property.description.baths}</h1>
                <h1>{property.status}</h1>  
                <button onClick={()=>{
                  fetch('/api',{
                    method:'POST',
                    mode:'cors',
                    headers:{'Content-Type':'application/json'},
                    body: JSON.stringify({
                      propertyPrice:property.list_price,
                      propertyBeds:property.description.beds,
                      propertyBaths:property.description.baths,
                      propertyStatus:property.status
                    })
                  })
                }}>Add to Database!</button>
              </div>))}
            <div>
            <Pagination>
            {showedData.map((item,page)=>{
              return (
                <Pagination.Item  key={page} active={page==currentPage} onClick={()=>{updatePage(page)}}></Pagination.Item>
              )
            })}
            </Pagination>
            </div>
          </div>
        )
         : null}
        </div>
        </div>
    )
}
